import Link from "next/link";

const Index = () => {
  return (
    <>
      <section class="hero has-text-light">
        <div class="hero-body">
          <div class="container">
            <h1 class="title">Next JS</h1>
            <h2 class="subtitle">Server side rendering</h2>
          </div>
        </div>
      </section>
    </>
  );
};

export default Index;
